// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";
import { getFirestore } from 'firebase/firestore'
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyB8EgGimhTTx5zP8iHU3wp_RcIz4GbuZUY",
  // authDomain: "mystockapp-23c4a.firebaseapp.com",
  // databaseURL: "https://mystockapp-23c4a-default-rtdb.firebaseio.com",
  // projectId: "mystockapp-23c4a",
  // storageBucket: "mystockapp-23c4a.appspot.com",
  // messagingSenderId: "202802184869",
  // appId: "1:202802184869:web:01834e99cf2585a61e834c",
  // measurementId: "G-LNTYTHGGS0"

  apiKey: "AIzaSyCdlbMDxaLWOWi7ZBeY6inRSsDogvZtG6c",
  authDomain: "mystock-55f72.firebaseapp.com",
  projectId: "mystock-55f72",
  storageBucket: "mystock-55f72.appspot.com",
  messagingSenderId: "945664376753",
  appId: "1:945664376753:web:003b7d2064ae6200018790",
  measurementId: "G-X01DG4MZMT"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

// Initialize Firebase Authentication and get a reference to the service
export const auth = getAuth(app);

// Initialize Firestore 
export default getFirestore( app );
